- input: TEXT,F3XA,,"Reference RQ-2 for 12 Day Pre-General Report Dear Ms. Phillips,  Our
    reports have been amended with the correct dates.  The reson that our Sechedule
    B and Schedule A sometimes slightly differ is becasue under the law which we follow
    our committee has up to 10 days to transmit funds to candidates.  Occassionaly
    we collect funds in one reporting period and do not distrubute them until the
    next reporting period.  We however are always in the 10 day period as requried
    by law.     If I can answer any further questions please let me know. Sincerely  Michael
    D. Bowman"
